import Post from './Post'

const Posts=(props)=>(
    <div className="posts">
        {
            props.articles.map(article=>(
                <Post 
                    key={article._id}
                    art={article}
                />
            ))
        }
        <aside>
            <h1>aside</h1>
        </aside>

        <style global jsx>
            {`
                .posts{
                    display:grid;
                    grid-template-columns:repeat(12,1fr)
                }
                aside{
                    grid-column:9/span 3;
                }

            `}
        </style>
    </div>
)

export default Posts
